import Vue from 'vue'
import Router from 'vue-router'
import Home from '@/views/Home.vue'
import Contact from '@/views/Contact.vue'
import About from '@/views/About.vue'
import Work from '@/views/Work'
import Resume from '@/views/Resume'
import Portfolio from '@/views/Portfolio'

Vue.use(Router)

export default new Router({
  mode: 'history',
  routes: [
    {
      path: '/',
      name: 'home',
      component: Home
    },
    {
      path: '/about',
      name: 'about',
      component: About
    },
    {
      path: '/work',
      name: 'work',
      component: Work
    },
    {
      path: '/contact',
      name: 'contact',
      component: Contact
    },
    {
      path: '/resume',
      name: 'resume',
      component: Resume
    },
    {
      path: '/portfolio',
      name: 'portfolio',
      component: Portfolio
    },
    { path: '*',
      redirect: '/'
    } // catch all use case
  ]
})
